import React from 'react';
import { Link as RouterLink } from 'react-router-dom';
import { ChakraProvider, Link, Center } from '@chakra-ui/react';

function Game() {
    return (
        <ChakraProvider>
            <div className='Game'>
                <Center>
                    This is the main game app. <br />
                    <Link as={RouterLink} to='/'>Home</Link> <br />
                    <Link as={RouterLink} to='/About'>About</Link>
                </Center>
            </div>
        </ChakraProvider>
    );
}


export default Game;
